import React from "react";


function Nav() {
  return (
    <nav className="row">
            <div class="nav-item col-md-4"><a class="nav-link" href="/">Clicky Game</a></div>
            <div class="nav-item col-md-4">Click an image to begin!</div>
            <div class="nav-item col-md-4">Scores go here!</div>
    </nav>
  );
}

export default Nav;
